import React from 'react';

// Header Component
function Header() {
  return (
    <header className="bg-gray-800 text-white p-4">
      <nav className="flex justify-around">
        <a href="#family" className="hover:underline">Family Friendly Tours</a>
        <a href="#holiday" className="hover:underline">Holiday & Seasonal Tours</a>
        <a href="#relaxation" className="hover:underline">Relaxation Tours</a>
        <a href="#adventure" className="hover:underline">Wild & Adventure Tours</a>
      </nav>
    </header>
  );
}

// Main Section Component
function MainSection() {
  const destinations = [
    "CASA Settat", "Fès Meknès", "L'Oriental",
    "Marrakech Safi", "Rabat Salé Kénitra", "Tanger Chefchaouen"
  ];

  return (
    <section className="grid grid-cols-2 md:grid-cols-3 gap-4 p-6">
      {destinations.map((dest, idx) => (
        <div key={idx} className="bg-gray-300 p-4 text-center">
          {dest}
        </div>
      ))}
    </section>
  );
}

// Footer Component
function Footer() {
  return (
    <footer className="bg-gray-900 text-white text-sm p-6">
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
        <div>
          <p>Address: 15 Rue Taoufik Al Hakim, Casablanca 20250, Morocco</p>
          <p>Whatsapp: +212 711 90 90 99</p>
          <p>Email: support@ma-tours.com</p>
        </div>
        <div>
          <a href="#terms" className="hover:underline">Terms and Conditions</a>
          <br />
          <a href="#privacy" className="hover:underline">Privacy Policy</a>
        </div>
        <p>COPYRIGHT 2025 MOROCCO TOURS & TRANSFERS, ALL RIGHT RESERVED</p>
      </div>
    </footer>
  );
}

// App Component combining all sections
function Fin() {
  return (
    <div>
      <Header />
      <MainSection />
      <Footer />
    </div>
  );
}

export default Fin;
